--Create Database QATest 
Use QATest
Create Table QAAsset (
	[qAssetId] 			int NOT NULL,
	[qAssetName]        VARCHAR (100) NOT NULL,
	[qAssetPath]        VARCHAR (300) NOT NULL,
	[qAssetAspectRatio] VARCHAR (15)  NOT NULL,
	[qAssetResolution]  VARCHAR (15)  NOT NULL,
	[qAssetContainer]   VARCHAR (15)  NOT NULL,
	[qAssetVideoCodec]  VARCHAR (15)  NOT NULL,
	[qVideoAvgBitRate]  VARCHAR (15)  NOT NULL,
	[qAssetAudioCodec]  VARCHAR (15)  NOT NULL,
	[qAudioAvgBitRate]  VARCHAR (15)  NOT NULL,
	[qAudioSampleRate]  VARCHAR (15)  NOT NULL,
	[qAssetAudioConfig] VARCHAR (15)  NOT NULL,
	[qAssetFPS]         VARCHAR (15)  NOT NULL,
	[qL0CheckSum]       VARCHAR (70)  NULL,
	[qAssetTimeStamp]   DATETIME      NULL,
	[qAudioBitDepth]    INT           DEFAULT ((0)) NULL,
	[qAssetDuration]    INT           DEFAULT ((0)) NOT NULL,
	[qAssetCCEmbedded]  VARCHAR (15)  DEFAULT ('') NOT NULL,
	[qAssetScanType]    VARCHAR (15)  DEFAULT ('') NOT NULL,
	PRIMARY KEY CLUSTERED ([qAssetId] ASC) );

Create Table QARelease (
	[qRelease]			varchar(5) NOT NULL,
	[qEnvironment]		varchar(5) NOT NULL,
	[qTestRunId]		int NOT NULL,
	[qComments]			varchar(500), 
	[qTestTimeStamp]	datetime,
	[qRegressionTitle]	varchar(50)
	CONSTRAINT pk_qReleaseEnvironmentTestRun PRIMARY KEY (qRelease,qEnvironment,qTestRunId) )

Create Table QATestRun (
	[qTestRunId]		int NOT NULL FOREIGN KEY REFERENCES QARelease(qTestRunId),
	[qAssetId]			int NOT NULL FOREIGN KEY REFERENCES QAAsset(qAssetId),
	[ALassetId]			int NOT NULL,
	[qTravellerXML]		xml,
	[qDescriptorXML]	xml,
	[qStatus]			varchar(500), 
	[qTestTimeStamp]	datetime,
	[qTranscoderConfig]	xml,
	[qAssetState]		varchar(20) NOT NULL,
	[qEnvironment]		varchar(5),
	[qL0CheckSum]		varchar(50) NOT NULL,
	[Priority]			varchar(10), 
	[Sequence]			int,
	[ALAssetName]		varchar(100)
	CONSTRAINT pk_qTestRunAssetId PRIMARY KEY (qTestRunId,qAssetId) )

CREATE TABLE [QAStream] (
    [qTestRunId]               INT             NOT NULL,
    [qAssetId]                 INT             NOT NULL,
    [ALassetId]                INT             NOT NULL,
    [ALstreamId]               INT             NOT NULL,
    [qVariantId]               INT             NOT NULL,
    [qStreamPath]              VARCHAR (300)   NOT NULL,
    [qElementaryVideoCheckSum] VARCHAR (70)    NULL,
    [qElementaryAudioCheckSum] VARCHAR (70)    NULL,
    [qL1ZeroOutCheckSum]       VARCHAR (70)    NULL,
    [qTestPassVideo]           INT             NULL,
    [qTestPassAudio]           INT             NULL,
    [qTestPassL1]              INT             NULL,
    [qTestTimeStamp]           DATETIME        NULL,
    [qSVNVerPipelineConfig]    VARCHAR (10)    NULL,
    [qSVNVerTN]                VARCHAR (15)    NULL,
    [qReferenceFlag]           BIT             NULL,
    [qTNIP]                    VARCHAR (16)    NULL,
    [qStatus]                  VARCHAR (500)   NULL,
    [qEnvironment]             VARCHAR (5)     NULL,
    [qFileName]                VARCHAR (40)    NOT NULL,
    [qElementaryCCfileSRT]     VARCHAR (5000)  NULL,
    [qTestPassCC]              INT             NULL,
    [qTestPassVideoOri]        INT             NULL,
    [qTestPassAudioOri]        INT             NULL,
    [qTestPassCCOri]           INT             NULL,
    [qTestPassL1Ori]           INT             NULL,
    [qStatusOri]               VARCHAR (500)   NULL,
    [qEncodeTime]              DECIMAL (10, 5) NULL,
    [qMuxTime]                 DECIMAL (10, 5) NULL,
    [qBatonFullDecodePass]     INT             NULL,
    [qFPS_ScanType]            VARCHAR (30)    NULL,
	[qFileListXML]			   XML			   NULL,
    [qTestPassFileListXML]     INT             NULL,
	CONSTRAINT [pk_qAssetVariantRun] PRIMARY KEY CLUSTERED ([qTestRunId], [ALassetId], [ALstreamId], [qVariantId], [qFileName]) )
	-- CONSTRAINT [fk_qTestRunAssetId]  FOREIGN KEY (qTestRunId,qAssetId) REFERENCES QATestRun (qTestRunId,qAssetId) )

GO
