DROP Table PipelineConfig
Create Table PipelineConfig (
	ProfileId int Not Null,
	VariantId varchar(10) Default Null,
	Env varchar(5) Default Null,
	OutputFileType varchar(20) Default Null,
	Muxer varchar(50) Default Null,
	OverallBitrate int Default Null,
	OutputFileExtension varchar(5) Default Null,
	VideoType varchar(10) Default Null,
	VideoEncoder varchar(15) Default Null,
	VideoWidth int Default Null,
	VideoHeight int Default Null,
	VideoFrameRate decimal (5,2) Default Null,
	VideoEmbedCCs varchar(20) Default Null,
	VideoPassthruCCs varchar(15) Default Null,
	VideoEmbedSCTE35 varchar(10) Default Null,
	VideoSupportedFrameRates varchar(100) Default Null,
	VideoCBRVBR varchar(5) Default Null,
	VideoBitrate int Default Null,
	VideoCPBBufferSize varchar(15) Default Null,
	VideoBufferFullnessInitial varchar(15) Default Null,
	VideoBufferFullnessTarget varchar(15) Default Null,
	VideoMaxIFrameSize varchar(15) Default Null,
	VideoMaxPFrameSize varchar(15) Default Null,
	VideoGOPLength varchar(15) Default Null,
	VideoMaxBFrames int Default Null,
	VideoAdaptiveBFrames varchar(5) Default Null,
	VideoSceneDetection varchar(5) Default Null,
	VideoProfile int Default Null,
	VideoLevel int Default Null,
	VideoPAR  varchar(15) Default Null,
	VideoPasses int Default Null,
	AudioType varchar(10) Default Null,
	AudioTargetLoudnessLKFS int Default Null,
	AudioUseSpeechGating varchar(5) Default Null,
	AudioSpeechGatingThreshold int Default Null,
	AudioMaxTruePeak int Default Null,
	AudioDynamicRangeCompression varchar(5) Default Null,
	AudioDRCThreshold int Default Null,
	AudioDialNorm int Default Null,
	AudioChannelFormat varchar(15) Default Null,
	AudioCBRVBR varchar(5) Default Null,
	AudioBitrate int Default Null,
	AudioMaxTracks int Default Null,
	CreationDateTime datetime 
	CONSTRAINT pk_PipelineConfig_ProfileId PRIMARY KEY (ProfileId) )

Create Table CustomerPriority (
	CustomerId int Not Null,
	CustomerName varchar(50) Not Null, 
	Priority Int Not Null, 
	Weight decimal(4,2) Not Null 
	CONSTRAINT pk_CustomerPriority_CustomerId PRIMARY KEY (CustomerId) )

Create Table L2CreationLogic (
	L2VariantId int Not Null, 
	UserStory varchar(30) Null, 
	VerifiedByQAEngName varchar(30) Not Null, 
	VerifiedByQADateTime datetime Not Null, 
	AspectRatio varchar(30), 
	HeighLow int, 
	HeighHigh int, 
	Audio varchar(30), 
	ScanType varchar(100), 
	FrameRate varchar(30), 
	DurationLimit int
	CONSTRAINT pk_L2CreationLogic_L2VariantId PRIMARY KEY (L2VariantId) )

Create Table L2Parents (
	L2VariantId int Not Null, 
	L1VariantId int Not Null, 
	OrderNumber int Not Null, 
	UserStory varchar(30) Not Null, 
	VerifiedByQAEngName varchar(30) Not Null, 
	VerifiedByQADateTime datetime Not Null 
	CONSTRAINT pk_L2Parents_L2VariantId_L1VariantId PRIMARY KEY (L2VariantId,L1VariantId) )

-- Drop Table AssetEventPriority
Create Table AssetEventPriority (
	qAssetId int Not Null, 
	WFPriority int Not Null, 
	EventId int Not Null, 
	Summary varchar(30) Not Null, 
	EventsQty int Not Null, 
	SequenceInRegression int Not Null, 
	Environment varchar(3)
	CONSTRAINT pk_AssetEventPriority_qAssetId_WFPriority_Summary_Environment PRIMARY KEY (qAssetId,WFPriority,Summary,Environment) )

-- sp_rename 'AssetEventPriority.Sequence', 'SequenceInRegression', 'COLUMN'

Create Table EventSequenceInWF (
	Summary varchar(30) Not Null, 
	SequenceInWF int Not Null
	CONSTRAINT pk_EventSequenceInWF_Summary PRIMARY KEY (Summary) )
