Create Table TJMJobAssignmentConfig (
	-- Jira CPS-XXXX
	TestCaseId varchar(10) Not Null,
	-- High priority takes over L,M,N
	TestCaseDescription varchar(30) Not Null,
	-- {{Cores,Qty}}
	TNsArray varchar(200) Not Null,
	-- {{assetId,Priority,Qty,PauseMsecs}}
	JobsArray varchar(200) Not Null,
	-- {{assetId,Sequence}}
	ExpectedJobCompletedArray varchar(500) Not Null,
	-- {assignmentState#, {{assetId,Initial,Assigned,Running,Complete,Cancel,Re-queued}}
	ExpectedJobAssignmentStatesArray varchar(500) Not Null,
				-- tnId = 0 = TJM
	-- {TJMState#,{{tnId#,Initial,Assigned,Running,Complete,Cancel,Re-queued}}
	ExpectedTJMStatesArray varchar(500) Not Null
	CONSTRAINT pk_TJMJobAssignmentConfig_TestCaseId PRIMARY KEY (TestCaseId) )

Create Table TJMJobAssignment (
	qTestRunId int Not Null,
	-- Jira CPS-XXXX
	TestCaseId varchar(10) Not Null,
	-- High priority takes over L,M,N
	TestCaseDescription varchar(30) Not Null,
	-- {{assetId,Sequence}}
	Result varchar(10) Not Null,
	Status varchar(200) Not Null Default '',
	ExpectedJobCompletedArray varchar(500) Not Null,
	-- {{assetId,Sequence}}
	ActualJobCompletedArray varchar(500) Not Null,
	-- {assignmentState#, {{assetId,Initial,Assigned,Running,Complete,Cancel,Re-queued}}
	ExpectedJobAssignmentStatesArray varchar(500) Not Null,
	-- {assignmentState#, {{assetId,Initial,Assigned,Running,Complete,Cancel,Re-queued}}
	ActualJobAssignmentStatesArray varchar(500) Not Null,
				-- tnId = 0 = TJM
	-- {TJMState#,{{tnId#,Initial,Assigned,Running,Complete,Cancel,Re-queued}}
	ExpectedTJMStatesArray varchar(500) Not Null,
				-- tnId = 0 = TJM
	-- {TJMState#,{{tnId#,Initial,Assigned,Running,Complete,Cancel,Re-queued}}
	ActualTJMStatesArray varchar(500) Not Null
	CONSTRAINT pk_TJMJobAssignment_qTestRunId_TestCaseId PRIMARY KEY (qTestRunId,TestCaseId) )

